// ---------- Loading Screen ---------- //

;(function(){
	function id(v){ return document.getElementById(v); }
	function loadbar() {
		var ovrl = id("overlay"),
			stat = id("progstat"),
			cvrl = id("content-overlay"),
			pvrl = id("progress-overlay"),
			itms = id("loading-items"),
			img = document.images,
			c = 0,
			tot = img.length;

		disableScroll();

		if(tot == 0) {
			setTimeout(function(){
				doneLoading();
			},200);
		}

		function imgLoaded(){
			c += 1;
			var perc = ((100/tot*c) << 0);

			stat.innerHTML = "Loading "+ perc + "%";

			if(c===tot) {
				setTimeout(function(){
					doneLoading();
				},300);
			}

		}
		function doneLoading(){

			enableScroll();


			TweenMax.to(
				ovrl,1.5,
				{width:0, ease:Expo.easeInOut, delay: .5}
			);
			TweenMax.to(
				pvrl,1.5,
				{width:0, ease:Expo.easeInOut, delay: .6}
			);
			TweenMax.to(
				cvrl,1.5,
				{alpha:0, ease:Power3.easeInOut, delay: .6}
			);
			TweenMax.to(
				itms,1.3,
				{alpha:0,ease:Expo.easeInOut, delay: .5}
			);
			setTimeout(function(){
				ovrl.style.display = "none";
				cvrl.style.display = "none";
			}, 2200);

			setTimeout(function(){
				triggerResize();
				headerAnimate();
				resizeImg();
			}, 600);

			setTimeout(function(){
				triggerResize();
			},1200);



		}
		for(var i=0; i<tot; i++) {
			var tImg     = new Image();
			tImg.onload  = imgLoaded;
			tImg.onerror = imgLoaded;
			tImg.src     = img[i].src;
		}
	}
	document.addEventListener('DOMContentLoaded', loadbar, false);
}());

function triggerResize(){
	var ev = document.createEvent('HTMLEvents');
	ev.initEvent('resize', true, false);
	window.dispatchEvent(ev);
};



// page header

function headerAnimate(){

	var pageHeader = document.getElementById('page-top-banner');
	if (pageHeader) {
		var title = pageHeader.querySelector('.q_splitText');
		var text = pageHeader.querySelector('p');
		var btn = pageHeader.querySelector('.link');

		q_animate(title, 'splitLeft', 100);
		q_animate(text, 'slideTop', 1);
		if (btn){
			q_animate(btn, 'slideTop', 1);
		}

	}
}






